import React from "react";
import {
  TextField,
  Button,
  Typography,
  Link,
  Grid,
  Box,
  Paper,
} from "@mui/material";
import {
  Google as GoogleIcon,
  Facebook as FacebookIcon,
  Person as PersonIcon,
  Lock as LockIcon,
} from "@mui/icons-material";
import { styled } from "@mui/system";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";

// Importing Poppins font
import "@fontsource/poppins/400.css";

// Importing Roboto font
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css";

import barbellIcon from "../Images/Login/23603572.png";
import bulkyManImage from "../Images/Login/bulky_man.png"; // Changed to PNG

// Create a theme to use Roboto globally
const theme = createTheme({
  typography: {
    fontFamily: "Roboto, Arial, sans-serif",
  },
});

const BackgroundBox = styled(Box)(({ theme }) => ({
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  height: "100vh",
  backgroundColor: "#f5f5f5",
}));

const FormBox = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  width: "100%",
  maxWidth: "683px",
  boxShadow: "0px 4px 20px rgba(0, 0, 0, 0.1)",
  borderBottomLeftRadius: "12px",
  borderTopLeftRadius: "12px",
  textAlign: "center",
}));

const InputBox = styled(Box)(({ theme }) => ({
  display: "flex",
  alignItems: "center",
  backgroundColor: "#e0f7fa",
  borderRadius: "8px",
  marginBottom: theme.spacing(2),
  width: "100%",
}));

const StyledTextField = styled(TextField)(({ theme }) => ({
  flex: 1,
  "& .MuiInputBase-input": {
    padding: "10px 12px",
  },
}));

const IconWrapper = styled(Box)(({ theme }) => ({
  padding: theme.spacing(1),
}));

const Login = () => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <BackgroundBox>
        <Box
          sx={{
            display: "flex",
            flexDirection: { xs: "column", md: "row" },
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <FormBox>
            <Typography
              component="h1"
              sx={{
                mt: 2,
                fontFamily: "Poppins, Arial, sans-serif",
                fontSize: "16px",
                fontWeight: 400, // Regular weight for Poppins
                paddingBottom: "5px", // Add padding below
              }}
            >
              Login and start bulking right now!
            </Typography>
            <img src={barbellIcon} alt="Barbell Icon" width="320" height="112" />
            <Box component="form" noValidate sx={{ mt: 2, width: "100%" }}>
              <InputBox>
                <IconWrapper>
                  <PersonIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  id="username"
                  label="Username"
                  name="username"
                  autoComplete="username"
                  autoFocus
                  variant="outlined"
                />
              </InputBox>
              <InputBox>
                <IconWrapper>
                  <LockIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="current-password"
                  variant="outlined"
                />
              </InputBox>
              <Link href="#" variant="body2" sx={{ alignSelf: "flex-start", mb: 2 }}>
                Forgot your password?
              </Link>
              <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{ mt: 3, mb: 2, backgroundColor: "#80cbc4", color: "#fff" }}
              >
                Login
              </Button>
              <Typography variant="body1" align="center" sx={{ mt: 2 }}>
                Login with Others
              </Typography>
              <Grid container spacing={2} sx={{ mt: 1 }}>
                <Grid item xs={12}>
                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<GoogleIcon />}
                    sx={{ backgroundColor: "#db4a39", color: "#fff", mb: 1 }}
                  >
                    Login with Google
                  </Button>
                </Grid>
                <Grid item xs={12}>
                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<FacebookIcon />}
                    sx={{ backgroundColor: "#3b5998", color: "#fff" }}
                  >
                    Login with Facebook
                  </Button>
                </Grid>
              </Grid>
              <Typography variant="body2" align="center" sx={{ mt: 2 }}>
                Not a member? <Link href="#">Register now</Link>
              </Typography>
            </Box>
          </FormBox>
          <Box
            sx={{
              display: { xs: "none", md: "flex" },
              justifyContent: "center",
              alignItems: "center",
              width: "683px",
              height: "768px",
              backgroundColor: "#d4d0ca", // Updated background color
              borderTopRightRadius: "12px",
              borderBottomRightRadius: "12px",
              overflow: "hidden",
            }}
          >
            <img
              src={bulkyManImage}
              alt="Fitness"
              style={{
                width: "683px",
                height: "683px",
                borderRadius: "12px",
              }}
            />
          </Box>
        </Box>
      </BackgroundBox>
    </ThemeProvider>
  );
};

export default Login;
